import React from 'react';
import '../App.css';
import { Link, Router } from 'react-router-dom';

function Navbar(){

    return(
        <div className= "navbar">
           <nav className="nav nav-wrapper blue-grey darken-4">
              <div className="container"> 
                <Router>
                 <Link className="brand-logo left">Covid19</Link>
                   <ul>
                     <li><a className ="india" href= "/#">Covid-News-Updates</a></li>
                     <li><a className ="india" href= "https://www.covid19india.org/">Indian-Covid-Cases</a></li>
            
                   </ul>
                </Router>
                </div>
           </nav>
         </div>
    );
}

export default Navbar;
